$(document).ready(function() {
  //window resize
  $(window).resize(function() {
    var winWidth = $(window).width();
    var winHeight = $(window).height();
    var asideWidth = $(".aside").outerWidth();
    var asideHeight = $(".aside").outerHeight();
    //g-wrap min-height
    $(".g-wrap").css("height", function(){ 
      var height = winHeight;
      return height;
    });
    //tab-pane
    $(".tab-content").css("height", function(){ 
      var a = $('.ventilation').outerHeight();
      var b = $('.msg-group').outerHeight();
      var height = asideHeight - a - b - 75;
      return height;
    });
    
    if ($(window).width() > 576) {
      $(".ventilation .btn").hover(function(){
        if($(this).children('.msg-notice').hasClass('loaded') == false) {
          $(this).children('.msg-notice').addClass('loaded');
          $(this).siblings().find('.msg-notice').removeClass('loaded');
        } else {
          $(this).children('.msg-notice').removeClass('loaded');
        }
      }); 
    }
  }).trigger('resize');

  //area
  $('.index area').hover(function(e) {
    var $id = $(this).attr('title').replace(/\s/g, '');
    var $item = $('.i[data-name=' + $id +']'); 
    if($(this).hasClass('active')== false){
      $(this).addClass('active').siblings().removeClass('active');
      $item.addClass('active');
      $('.image-main').addClass($id).addClass('active');
    } else {
      $(this).removeClass('active');
      $item.removeClass('active');
      $('.image-main').removeClass($id).removeClass('active');
    }
  });
  $('.page area').hover(function(e) {
    var $id = $('.image-thumb').data('id').replace(/\s/g, '');
    var $area = $(this).attr('title').replace(/\s/g, '');
    var $item = $('.image-thumb img[data-title=' + $area +']'); 
    var $current = $('.image-thumb img[data-title=' + $id +']');
    if($(this).hasClass('active')== false){
      $(this).addClass('active').siblings().removeClass('active');
      $item.css('opacity','1').siblings().css('opacity','0');
    } else {
      $(this).removeClass('active');
      $current.css('opacity','1').siblings().css('opacity','0');
    }
  });

  //cleanroom
  if($('.g-grid').hasClass('cleanhome')) {
    $('.g-grid').addClass('loaded');
  }

  // position
  $('.i,.room').each(function(i,element) {
    var _posx = $(element).data('x'),
        _posy = $(element).data('y');
    $(element).css({
      'top':_posx,
      'left':_posy
    });
  });
  //map resize
  imageMapResize();
  //zoom-wrap
  $('.i.influences').click(function(e) {
    var $id = $(this).data("id");
    var $item = $('.zoom-wrap[data-item=' + $id +']');
    var $pane = $('.tab-pane[data-item=' + $id +']');
    $('.g-wrap,.image-main').addClass('active');
    $item.addClass('active');
    $('#home.tab-pane').css('display','none').css('opacity','0');
    $pane.css('display','block').css('opacity','1');
  });
  $('.i.improvement').click(function(e) {
    var $id = $(this).data("id");
    var $item = $('.zoom-wrap[data-item=' + $id +']');
    var $pane = $('.tab-pane[data-item=' + $id +']');
    $('.g-wrap,.image-main').addClass('active');
    $item.addClass('active').siblings().removeClass('active');
  });
  //close
  $('.btn.close').click(function(e) {
    var $id = $(this).parent().parent().parent().data("item");
    var $item = $('.zoom-wrap[data-item=' + $id +']');
    var $pane = $('.tab-pane[data-item=' + $id +']');
    $('.g-wrap,.image-main').removeClass('active');
    $item.removeClass('active');
    $('#home.tab-pane').css('display','block').css('opacity','1');
    $pane.css('display','none').css('opacity','0');
  });
  $('.cleanhome .btn.close').click(function(e) {
    $(this).parent().removeClass('active');
  });


});

 //AOS
AOS.init({
  duration: 500,
  once: true,
  // startEvent: 'DOMContentLoaded',
});

